<!doctype html>
<html lang="ja">
<head>
  <meta charset="utf-8">
  <meta name="viewport" content="width=device-width, initial-scale=1">
  <title>鉱物ズーム観察（完全オフライン・メタ情報表示）</title>
  
  <style>
    :root{--panel:#111827;--card:#1f2937;--text:#e5e7eb;--muted:#9ca3af;--accent2:#60a5fa;--ok:#34d399;--warn:#f59e0b;--dark:#111827;}
    *{box-sizing:border-box}html,body{height:100%}
    body{margin:0;background:linear-gradient(180deg,#0b1021,#10172d);color:var(--text);
      font-family:-apple-system,BlinkMacSystemFont,"Segoe UI",Roboto,"Hiragino Kaku Gothic ProN","Noto Sans JP","Yu Gothic",Meiryo,sans-serif}
    .app{display:grid;grid-template-columns:340px 1fr;height:100vh}
    aside{padding:16px;background:var(--panel);border-right:1px solid #0b1222;overflow:auto}
    main{display:flex;flex-direction:column;min-width:0}
    h1{font-size:18px;margin:0 0 8px 0;font-weight:700}.hint{color:var(--muted);font-size:12px;line-height:1.5}
    .btn{width:100%;text-align:left;background:var(--card);border:1px solid #2b374a;color:var(--text);border-radius:14px;padding:10px 12px;margin:6px 0;cursor:pointer;transition:transform .05s ease,background .2s ease,border-color .2s ease}
    .btn:hover{background:#263246}.btn.active{outline:2px solid var(--accent2);border-color:var(--accent2)}.mini{font-size:11px;color:var(--muted);display:block;margin-top:2px}
    .viewer-bar{display:flex;align-items:center;gap:12px;padding:10px 14px;background:rgba(31,41,55,.6);border-bottom:1px solid #0b1222;position:sticky;top:0;backdrop-filter:blur(4px)}
    .tag{background:#0f3b24;color:#8ff0b2;border:1px solid #1f6d46;padding:3px 8px;border-radius:999px;font-size:12px}.grow{flex:1 1 auto}
    .ctrl{display:flex;align-items:center;gap:8px;background:var(--card);border:1px solid #2b374a;padding:6px 10px;border-radius:12px}
    .ctrl button,.ctrl input[type=range]{background:transparent;color:var(--text);border:none}.ctrl button{cursor:pointer;padding:6px 10px;border-radius:8px}.ctrl button:hover{background:#263246}
    #stage{position:relative;flex:1 1 auto;min-height:0;overflow:hidden;background:radial-gradient(ellipse at 50% 50%,#0f172a 0%,#0b1021 60%);border-bottom:1px solid #0b1222}
    #canvasWrap{position:absolute;inset:0;overflow:hidden;cursor:grab}#canvasWrap.dragging{cursor:grabbing}
    #img{position:absolute;top:0;left:0;transform-origin:0 0;user-select:none;-webkit-user-drag:none;pointer-events:none;will-change:transform;image-rendering:auto}
    .meta{display:grid;grid-template-columns:repeat(3,1fr);gap:8px;padding:10px 14px;background:rgba(17,24,39,.6);border-top:1px solid #0b1222;border-bottom:1px solid #0b1222}
    .pill{display:inline-block;padding:4px 10px;border-radius:999px;font-size:12px;border:1px solid #264e36;background:#0c2a1b;color:#a7f3d0}
    .pill.warn{border-color:#654321;background:#2a1d0c;color:#fde68a}
    .metaItem{font-size:13px;color:#d1d5db}
    .label{color:#9ca3af;font-size:12px}
    .credit{padding:10px 14px;font-size:12px;color:var(--muted);background:rgba(17,24,39,.6)}
    .zoomBadge{position:absolute;top:10px;right:10px;background:rgba(0,0,0,.45);border:1px solid #2b374a;padding:6px 10px;border-radius:10px;font-size:12px}
    .footer{text-align:center;padding:8px;font-size:11px;color:var(--muted)}
    @media (max-width:900px){.app{grid-template-columns:1fr}aside{order:2;height:42vh}#stage{height:50vh}.meta{grid-template-columns:1fr}}
  </style>

</head>
<body>
<div class="app">
  <aside>
    <h1>鉱物を選択</h1>
    <div class="hint">完全オフライン：画像は本ファイルに埋め込み済み。<br>ドラッグ移動／ホイール・ピンチ＝拡大縮小／ダブルクリック＝リセット。</div>
    <div id="list"></div>
  </aside>
  <main>
    <div class="viewer-bar">
      <span class="tag" id="mineralTag">—</span>
      <div class="grow"></div>
      <div class="ctrl">
        <button id="resetBtn">リセット</button>
        <span>倍率</span>
        <input id="zoomSlider" type="range" min="0.25" max="16" step="0.01" value="1" style="width:180px">
      </div>
    </div>
    <div id="stage">
      <div id="canvasWrap">
        <img id="img" alt="鉱物写真">
      </div>
      <div class="zoomBadge" id="zoomBadge">100%</div>
    </div>
    <div class="meta">
      <div class="metaItem"><span class="label">分類</span><br><span id="metaClass" class="pill">—</span></div>
      <div class="metaItem"><span class="label">色</span><br><span id="metaColor">—</span></div>
      <div class="metaItem"><span class="label">石の形（結晶形・産状）</span><br><span id="metaShape">—</span></div>
    </div>
    <div class="credit" id="credit"></div>
    <div class="footer">注：分類は授業用に簡略化（有色＝苦鉄質系／無色＝珪長質系。不透明鉱物は別扱い）。</div>
  </main>
</div>

  const list = document.getElementById('list');
  const img = document.getElementById('img');
  const wrap = document.getElementById('canvasWrap');
  const zoomSlider = document.getElementById('zoomSlider');
  const zoomBadge = document.getElementById('zoomBadge');
  const credit = document.getElementById('credit');
  const tag = document.getElementById('mineralTag');
  const resetBtn = document.getElementById('resetBtn');

  const metaClass = document.getElementById('metaClass');
  const metaColor = document.getElementById('metaColor');
  const metaShape = document.getElementById('metaShape');

  function rebuildList(){
    list.innerHTML = '';
    MINERALS.forEach((m) => {
      const btn = document.createElement('button');
      btn.className = 'btn';
      btn.dataset.key = m.key;
      btn.innerHTML = `<div style="display:flex;justify-content:space-between;align-items:center;gap:8px">
        <div>
          <div style="font-weight:700">${m.jp}</div>
          <span class="mini">${m.en}</span>
        </div>
        <span class="mini">${m.classLabel||""}</span>
      </div>`;
      btn.addEventListener('click', () => selectMineral(m.key));
      list.appendChild(btn);
    });
  }

  let current = null;
  let state = { scale: 1, x: 0, y: 0, imgW: 1, imgH: 1, viewW: 1, viewH: 1, pointers: new Map(), pinch: null };

  function selectMineral(key){
    const m = MINERALS.find(x => x.key === key) || MINERALS[0];
    current = m;
    document.querySelectorAll('.btn').forEach(b=>b.classList.toggle('active', b.dataset.key===key));
    tag.textContent = m.jp;

    img.onload = () => {
      state.imgW = img.naturalWidth || 1;
      state.imgH = img.naturalHeight || 1;
      resetView();
    };
    img.src = m.url;
    img.alt = (m.jp || '') + ' の写真';
    credit.textContent = m.credit || '';

    // metadata
    metaClass.textContent = m.classLabel || (m.colored ? '有色鉱物' : '無色鉱物');
    metaClass.className = 'pill' + (m.opaque ? ' warn' : '');
    metaColor.textContent = m.colorText || '—';
    metaShape.textContent = m.shapeText || '—';

    document.title = `鉱物ズーム観察：${m.jp || ''}`;
  }

  function resetView(){
    const rect = wrap.getBoundingClientRect();
    const scaleToFit = Math.min(rect.width/state.imgW, rect.height/state.imgH);
    state.scale = Math.max(0.25, scaleToFit * 1.05);
    state.x = (rect.width - state.imgW * state.scale) / 2;
    state.y = (rect.height - state.imgH * state.scale) / 2;
    applyTransform();
    zoomSlider.value = state.scale.toFixed(2);
    updateZoomBadge();
  }

  function applyTransform(){
    img.style.transform = `translate(${state.x}px, ${state.y}px) scale(${state.scale})`;
  }

  function setScale(newScale, cx, cy){
    const min = 0.25, max = 16;
    const old = state.scale;
    newScale = Math.min(max, Math.max(min, newScale));
    const rect = wrap.getBoundingClientRect();
    const dx = (cx - rect.left - state.x) / old;
    const dy = (cy - rect.top - state.y) / old;
    state.x = cx - rect.left - dx * newScale;
    state.y = cy - rect.top - dy * newScale;
    state.scale = newScale;
    applyTransform();
    zoomSlider.value = state.scale.toFixed(2);
    updateZoomBadge();
  }

  function updateZoomBadge(){ zoomBadge.textContent = Math.round(state.scale*100) + "%"; }

  wrap.addEventListener('wheel', (e) => {
    e.preventDefault();
    const delta = -e.deltaY;
    const factor = Math.exp(delta * 0.0015);
    setScale(state.scale * factor, e.clientX, e.clientY);
  }, {passive:false});

  let dragging = false, startX=0, startY=0, startOffsetX=0, startOffsetY=0;
  function onPointerDown(e){
    wrap.setPointerCapture(e.pointerId);
    if(e.button !== undefined && e.button !== 0) return;
    state.pointers.set(e.pointerId, {x:e.clientX, y:e.clientY});
    if(state.pointers.size === 2){
      const pts = Array.from(state.pointers.values());
      state.pinch = { dist: Math.hypot(pts[0].x-pts[1].x, pts[0].y-pts[1].y), scale: state.scale };
    }else if(state.pointers.size === 1){
      dragging = true; wrap.classList.add('dragging');
      startX = e.clientX; startY = e.clientY;
      startOffsetX = state.x; startOffsetY = state.y;
    }
  }
  function onPointerMove(e){
    if(!state.pointers.has(e.pointerId)) return;
    state.pointers.set(e.pointerId, {x:e.clientX, y:e.clientY});
    if(state.pointers.size === 2 && state.pinch){
      const pts = Array.from(state.pointers.values());
      const dist = Math.hypot(pts[0].x-pts[1].x, pts[0].y-pts[1].y);
      const factor = dist / (state.pinch.dist || dist);
      const centerX = (pts[0].x + pts[1].x) / 2;
      const centerY = (pts[0].y + pts[1].y) / 2;
      setScale(state.pinch.scale * factor, centerX, centerY);
    } else if(dragging){
      const dx = e.clientX - startX;
      const dy = e.clientY - startY;
      state.x = startOffsetX + dx;
      state.y = startOffsetY + dy;
      applyTransform();
    }
  }
  function onPointerUp(e){
    wrap.releasePointerCapture(e.pointerId);
    state.pointers.delete(e.pointerId);
    if(state.pointers.size < 2){ state.pinch = null; }
    if(state.pointers.size === 0){ dragging = false; wrap.classList.remove('dragging'); }
  }
  wrap.addEventListener('pointerdown', onPointerDown);
  wrap.addEventListener('pointermove', onPointerMove);
  wrap.addEventListener('pointerup', onPointerUp);
  wrap.addEventListener('pointercancel', onPointerUp);
  wrap.addEventListener('pointerleave', onPointerUp);

  wrap.addEventListener('dblclick', resetView);

  zoomSlider.addEventListener('input', e => {
    const rect = wrap.getBoundingClientRect();
    setScale(parseFloat(e.target.value), rect.left + rect.width/2, rect.top + rect.height/2);
  });
  resetBtn.addEventListener('click', resetView);

  new ResizeObserver(()=>{ if(current) resetView(); }).observe(document.body);

  rebuildList();
  selectMineral('olivine');

</script>
</body>
</html>
